import React, { useState, useEffect } from "react";
import "./chess.scss";
import Board from "./board.jsx";

function Chess(props) {
  return (
    <svg>
      <image
        id="p01"
        href="../images/Pieces/horse-black.gif"
        width="65.11111111111111"
        height="65.11111111111111"
        transform="translate(65.11111111111111, 0)"
      ></image>
    </svg>
  );
}

export default Chess;
